import "./styles.css";

export default function Project() {
  const image1 = document.getElementById("image1");
  const image1file = document.getElementById("image1file");
  const image2 = document.getElementById("image2");
  const image2file = document.getElementById("image2file");
  const leftText = document.getElementById("leftText");
  const rightText = document.getElementById("rightText");

  const Paragraphs = {
    1: 'Pair programming in a team of seven <br> developers deploying a new mobile <br> application. Integrating and designing <br>twelve front-end React components and APIs via Github, prioritising principles of object-oriented programming.',
    2: 'Managed web development for new Soho-based Bar Kroketa. The process involved communicating in a team of eight designers, entrepreneurs and advertising executives to agree on a viable digital presence. Anticipated server issues with web deployment and suggested solutions allowing us to launch a five page, dynamic website within stringent deadlines. Constructed with Squarespace, extensive custom CSS and HTML mailers.',
    3: 'Creating a website using PHP, CSS, HTML, and JavaScript involves combining front-end and back-end technologies to build the structure, style, and interactivity. Deploying it on an FTP server requires configuring file transfers and ensuring proper server setup for PHP execution. Attention to file organization and testing is crucial for a successful online presence.',
    4: 'Created Machine Learning Algorithm',
    5: 'Collaborated with researchers Professor Samuel Solomon and Dr Lasana Harris on a third year research project. Developed own hypotheses and programmed new experimental technique using Bonvision interface. My paradigm has been adopted by subsequent researchers demonstrating its technical aptitude and versatility. Presented progress and discussed findings at weekly meetings with both senior researchers and software developer, Goncalo Lopes.'
  }

  function showPicture(x) {
    if (x === "favourite") {
      image1.style.display = "block";
      image1file.src = "images/favanswer.jpg";
      leftText.innerHTML = Paragraphs[1];
    } else if (x === "kroketa") {
      image2.style.display = "block";
      image2file.src = "images/kroketa.jpg";
      rightText.innerHTML = Paragraphs[2];
    } else if (x === "vinos") {
      image2.style.display = "block";
      image2file.src = "images/vinos.jpg";
      rightText.innerHTML = Paragraphs[4];
    }else if (x === "gender") {
      image1.style.display = "block";
      image1file.src = "images/sample.jpeg";
      leftText.innerHTML = Paragraphs[3];
    }else if (x === "animacy") {
      image1.style.display = "block";
      image1file.src = "images/animacy.png";
      leftText.innerHTML = Paragraphs[5];
    }
  }
  function hidePicture(x) {
    image1.style.display = "none";
    image2.style.display = "none";
  }
  return (
    <div>
      <div
        className="projectDiv"
        id="projectDiv"
        onMouseOver={() => showPicture("favourite")}
        onMouseLeave={hidePicture}
      >
        <h2>Favourite Answer</h2>
        <small>React, JSX & CSS</small>
      </div>
      <div
        className="projectDiv"
        id="projectDiv"
        onMouseOver={() => showPicture("kroketa")}
        onMouseLeave={hidePicture}
      >
        <h2>Kroketa Website</h2>
        <small>Squarespace & Custom CSS</small>
      </div>
      <div
        className="projectDiv"
        id="projectDiv"
        onMouseOver={() => showPicture("gender")}
        onMouseLeave={hidePicture}
      >
        <h2>Gender Pay Gap AI</h2>
        <small>Python</small>
      </div>
      <div
        className="projectDiv"
        id="projectDiv"
        onMouseOver={() => showPicture("vinos")}
        onMouseLeave={hidePicture}
      >
        <h2>Vinos Colltor Website</h2>
        <small>HTML, CSS, Javascript & PHP</small>
      </div>
      <div
        className="projectDiv"
        id="projectDiv"
        onMouseOver={() => showPicture("animacy")}
        onMouseLeave={hidePicture}
      >
        <h2>Animacy Testing Paradigm</h2>
        <small>Bonsai & Bonvision</small>
      </div>
    </div>
  );
}
